An helpful navigation marine tool for sailors, yachts and boats.

This app contains a set of nautical applications:
- Speedometer in knots, mph or km/h, Course over Ground;
- Position;
- Mark or edit waypoints;
- Distance measurement in nautical miles and meters. Also useful for anchoring;
- Course to Waypoint.

The app contains ads.

